import React, {useEffect, useState} from "react";


const Button = (props) => {
    const [click, setClick] = useState(0)

    useEffect(() => {
        document.title = `you click ${click}`
    })
    console.log(click)
      return (
        <button onClick={()=> setClick(click + 1)}>{props.text} {click}</button>
      )
}
Button.defaultProps = {
    text: 'button'
}
export default Button;
